import React from 'react';
import './HomePage.css';
import { faUserPlus } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const HomePage = () => {
  return (
    <div className="home-page">
      <div className="left-side">
        <h2>Welcome to Talent Tracker</h2>
        <p>
          We are dedicated to helping you track and manage talented individuals efficiently.
          Whether you are a recruiter looking for top talents or an individual seeking new opportunities,
          Talent Tracker provides a comprehensive platform to discover and connect with skilled professionals
          across various industries. With our innovative tools and user-friendly interface,
          you can streamline the talent tracking process and make informed decisions with ease.
          Join us today and unlock the full potential of talent management!


        </p>
        <a href="/register" className="cta-button"><FontAwesomeIcon icon={faUserPlus} />Register</a>
    
      </div>
      <div className="right-side">
        <h2>About Us</h2>
        <p>
          Talent Tracker is a leading platform designed to revolutionize talent acquisition and management.
          Our mission is to bridge the gap between job seekers and recruiters by simplifying the recruitment process.
          We understand the importance of finding the right talent for your organization, and we are committed
          to providing the tools and insights you need to make smart hiring decisions.
          Join our growing community of satisfied users and experience the future of talent tracking!
        </p>
        
      </div>
    </div>
  );
};

export default HomePage;
